package org.walkframework.base.system.task.notify;import java.io.Serializable;import java.util.Date;  /** * @author shf675 * */public class NotifyData implements Serializable {	private static final long serialVersionUID = 1L;		 /**		 *通知对象类型	 */		private String objectType;		 /**		 *通知对象编码		 */		private String objectCode;	 /**		 *通知内容		 */		private String notifyContent;	 /**		 *计划通知时间		 */		private Date notifyPlanTime;	public String getObjectType() {		return objectType;	}	public void setObjectType(String objectType) {		this.objectType = objectType;	}	public String getObjectCode() {		return objectCode;	}	public void setObjectCode(String objectCode) {		this.objectCode = objectCode;	}	public String getNotifyContent() {		return notifyContent;	}	public void setNotifyContent(String notifyContent) {		this.notifyContent = notifyContent;	}	public Date getNotifyPlanTime() {		return notifyPlanTime;	}	public void setNotifyPlanTime(Date notifyPlanTime) {		this.notifyPlanTime = notifyPlanTime;	}}